INSERT INTO `post` (`id`, `titulo`, `subtitulo`, `texto`, `usuario_id`, `imagen`, `categoria`) VALUES
(2, 'Leyenda de Lakers revienta a LeBron James: \'Los grandes no hacen eso\'.', 'Kareem Abdul-Jabbar, gloria de Los Angeles Lakers, tundió a LeBron James luego de que este se tomara de los genitales en un baile al festejar.', 'Una nueva polémica aqueja a la súper estrella de la NBA, LeBron James, quien luego de ser multado por la liga por realizar un gesto obsceno al festejar en el juego ante los Indiana Pacers, también fue blanco de las críticas de una leyenda de Los Angeles Lakers. \"Para mí, ganar es suficiente. ¿Por qué tienes que hacer un baile estúpido e infantil y faltar el respeto al otro equipo sobre la pista? No tiene ningún sentido. Los más grandes no hace eso, no bailan\", espetó Kareem Abdul-Jabbar.', 1, , 'Basquetbol');
INSERT INTO `post` (`id`, `titulo`, `subtitulo`, `texto`, `usuario_id`, `imagen`, `categoria`) VALUES
(3, 'Julio Urías gana Premio a lanzador zurdo más destacado de MLB.', 'El mexicano tuvo otro logro antes de terminar el año, esta vez ganando el Premio Warren Spahn de Grandes Ligas.', 'Julio Urías tuvo la mejor temporada de su carrera al momento luego de terminar como el líder de juegos ganados en las Grandes Ligas con 20 triunfos, razón suficiente para que se lleve esta distinción, además de que finalizó con la octava mejor efectividad en todas las Mayores con 2.96 y 1.02 de porcentaje de bases por bola y hits efectuados por entrada. El Premio Warren Spahn se otorga al lanzador zurdo más destacado de la temporada, tomando en cuenta las siguientes estadísticas: su récorda de ganados, su efectividad y su WHIP. Este es el tercer reconocimiento que recibe el sinaloense, tras haber sido nombrado para el Segundo Equipo de Estrellas de Grandes Ligas de la temporada 2021 y luego de recibir el Premio Nacional del Deporte 2021 a finales de noviembre.', 1, , 'Beisbol');
INSERT INTO `post` (`id`, `titulo`, `subtitulo`, `texto`, `usuario_id`, `imagen`, `categoria`) VALUES
(4, 'Aaron Rodgers asegura que su lesión de pie progresa de manera acelerada.', 'Aaron Rodgers declinó a ser operado por una lesión en el pie izquierdo y el QB optó por una rehabilitación durante el bye week de los Packers.', 'La semana de descanso llegó a Green Bay en el momento adecuado para que Aaron Rodgers sane de su lesión en el pie. El propio quarterback reveló que los días sin actividad ayudaron a sentirse mejor. En una de sus recurrentes visitas al Pat McAfee Show, el pasador de los Packers informó que los días de descanso en Lambeau Field permitieron que su fractura en el pie izquierdo mejorara. \"No cambió mi mentalidad. La clave es el descanso\", desarrolló. \"Me gustaría que tuviéramos una de esas semanas de descanso en los que tienes 14 o 21 grandes días sin hacer nada, pero mi dedo ha mejorado. Veremos cómo se siente más adelante\". Asimismo, el vigente MVP de la liga indicó que durante la bye week, viajó a Los Angeles para consultar a un médico y tras visitar al galeno determinó que no era necesario ser intervenido quirúrgicamente. Previo a la derrota de los Packers en Minnesota (duelo correspondiente a la semana 11), Rodgers reveló que tenía una afección en su extremidad inferior. A pesar de que el quirófano era opción, el egresado de California se negó a ser operado.', 1, , 'FA');
INSERT INTO `post` (`id`, `titulo`, `subtitulo`, `texto`, `usuario_id`, `imagen`, `categoria`) VALUES
(5, 'El rubro donde Checo Pérez superó a Hamilton durante la temporada 2021.', 'El piloto mexicano fue reconocido por la Fórmula 1 por su destacado rendimiento sobre los trazados callejeros, donde tuvo mejores resultados que el británico.', 'La Fórmula 1 está a escasos días de concluir la temporada 2021 con Max Verstappen y Lewis Hamilton como los grandes protagonistas del año, pues llegan a la última carrera con los mismos puntos cosechados y con la gran incógnita de quién será el nuevo campeón de la categoría. En un segundo peldaño se ubican Valtteri Bottas y Sergio Pérez, quienes tras concluir el Gran Premio de Arabia Saudita definieron las posiciones como tercer y cuarto lugar del campeonato, respectivamente, por lo que el mexicano volvió a concluir en esta posición por segundo año consecutivo. A pesar de que Checo no pudo superar en puntos a ninguno de sus rivales directos, existió un rubro donde el tapatío fue superior a los dos hombres de Mercedes y que incluso ganó el reconocimiento por parte de la cuenta oficial de Fórmula 1, ya que publicaron la tabla de los mejores pilotos sobre circuitos urbanos del año.', 1, , 'F1');
INSERT INTO `post` (`id`, `titulo`, `subtitulo`, `texto`, `usuario_id`, `imagen`, `categoria`) VALUES
(7, 'América: Azcárraga dejó entrever que aprueba trueque Córdova-Antuna con chivas.', 'El dueño de las Águilas aseguró que un cambio así puede ser difícil para directiva y afición pero debe haber análisis deportivo.', 'La ‘novela del verano’ tiene un nuevo capítulo, pues Emilio Azcárraga, dueño de las Águilas, rompió el silencio sobre la posibilidad de un trueque entre Chivas y América por Uriel Antuna y Sebastián Córdova. “Para la afición puede ser difícil, para mí puede ser difícil, para Amaury (Vergara) puede ser difícil, pero finalmente se debe de hacer un análisis de parte de la dirección deportiva de todos los equipos y ver quién es el jugador que debe estar”, explicó para TUDN durante la inauguración de una cancha en Amatitán, Jalisco. “Se debe de tratar que los mejores once jugadores que estén en la cancha del América sean los mejores once que podemos conseguir”, agregó el directivo. ', 3, , 'Futbol');

